import React from "react";
import './Prototyping.css';
import "@fontsource/red-hat-display";
import logo from './resources/logo.gif';

import contentIcon from './resources/uiux-background.svg';

import './../min.css';
import downArrow from './resources/downArrow.svg'
function OurService(){
    return(
        <div className="body-prototype-service">
            <h3 className="our-service-text">Our Service</h3>
            <div className="row">
                <div className="box white-background text-center"><img src={contentIcon} style={{width:'100%'}}/><p className="service-specific-text">Governance</p><img src={downArrow} style={{width:'30px'}}/></div>
                <div className="box white-background text-center"><img src={contentIcon} style={{width:'100%'}}/><p className="service-specific-text">UI/UX Prototype</p><img src={downArrow} style={{width:'30px'}}/></div>
                <div className="box white-background text-center"><img src={contentIcon} style={{width:'100%'}}/><p className="service-specific-text">Content</p><img src={downArrow} style={{width:'30px'}}/></div>
           </div>
        </div>

    );
}
export default OurService;
